import{r,o as t,c as n,a as e,b as o,F as s,d as a,e as c}from"./app.9aaa2256.js";import{_ as d}from"./plugin-vue_export-helper.21dcd24c.js";const g={},b=a('<h3 id="\u6BCD\u4E73\u6027\u9EC4\u75B8-\u770B\u8FD9\u7BC7\u5C31\u591F\u4E86" tabindex="-1"><a class="header-anchor" href="#\u6BCD\u4E73\u6027\u9EC4\u75B8-\u770B\u8FD9\u7BC7\u5C31\u591F\u4E86" aria-hidden="true">#</a> \u6BCD\u4E73\u6027\u9EC4\u75B8\uFF0C\u770B\u8FD9\u7BC7\u5C31\u591F\u4E86</h3><p>\u6BCD\u4E73\uFF0C\u662F\u5A74\u513F\u6700\u597D\u7684\u8425\u517B\u6765\u6E90\u3002\u53EA\u8981\u5988\u5988\u6216\u5B69\u5B50\u6CA1\u60A3\u7279\u6B8A\u75BE\u75C5\u6216\u8005\u5988\u5988\u6CA1\u6709\u4F7F\u7528\u7279\u6B8A\u836F\u7269\uFF0C6\u4E2A\u6708\u5185\u7684\u5B69\u5B50\u90FD\u5E94\u8BE5\u63A5\u53D7\u7EAF\u6BCD\u4E73\u5582\u517B\u3002</p><p>\u4F46\u662F\uFF0C\u7EAF\u6BCD\u4E73\u5582\u517B\u6216\u8005\u4EE5\u6BCD\u4E73\u5582\u517B\u4E3A\u4E3B\u7684\u5B69\u5B50\uFF0C\u751F\u540E\u4F9D\u7136\u53EF\u80FD\u9762\u4E34\u4E00\u4E9B\u98CE\u9669\u3002\u6BD4\u5982\uFF0C\u6BCD\u4E73\u4E2D\u7EF4\u751F\u7D20D3\u542B\u91CF\u5F88\u5C11\uFF0C\u5B69\u5B50\u751F\u540E\u6570\u65E5\u9700\u8981\u670D\u7528\u7EF4\u751F\u7D20D3\u9884\u9632\u4F5D\u507B\u75C5\u3002\u5982\u679C\u5B69\u5B50\u662F\u7EAF\u6BCD\u4E73\u5582\u517B\u6216\u8005\u4EE5\u6BCD\u4E73\u5582\u517B\u4E3A\u4E3B\uFF0C\u56F0\u6270\u5BB6\u957F\u7684\u53E6\u4E00\u4E2A\u95EE\u9898\u662F\u9EC4\u75B8\u4F1A\u504F\u9AD8\u6216\u6301\u7EED\u66F4\u4E45\uFF0C\u4E5F\u5C31\u662F\u6BCD\u4E73\u6027\u9EC4\u75B8\u3002</p><p>\u5176\u5B9E\u548C\u6BCD\u4E73\u6709\u5173\u7684\u9EC4\u75B8\u6709\u4E24\u79CD\uFF1A\u4E00\u79CD\u662F\u51FA\u751F\u4E00\u5468\u5185\uFF0C\u56E0\u4E3A\u6BCD\u4E73\u5582\u517B\u9047\u5230\u56F0\u96BE\uFF0C\u5BFC\u81F4\u65B0\u751F\u513F\u6444\u5165\u4E0D\u8DB3\u5BFC\u81F4\u9EC4\u75B8\u52A0\u91CD\uFF0C\u79F0\u4E3A<strong>\u6BCD\u4E73\u5582\u517B\u5931\u8D25\u6027\u9EC4\u75B8</strong>\uFF0C\u53E6\u4E00\u79CD\u662F\u5B69\u5B50\u6BCD\u4E73\u5582\u517B\u800C\u4E14\u751F\u957F\u53D1\u80B2\u826F\u597D\uFF0C\u4F46\u9EC4\u75B8\u51FA\u73B0\u65F6\u95F4\u8F83\u665A\uFF0C\u800C\u4E14\u6301\u7EED\u5F88\u4E45\u4E0D\u9000\uFF0C\u4E5F\u5C31\u662F\u6211\u4EEC\u8BF4\u7684<strong>\u6BCD\u4E73\u6027\u9EC4\u75B8</strong>\u3002</p><p>\u76EE\u524D\u8BA4\u4E3A\u65E9\u671F\u5582\u517B\u4E0D\u8DB3\u53EF\u5F15\u8D77\u9EC4\u75B8\uFF0C\u968F\u7740\u575A\u6301\u7EAF\u6BCD\u4E73\u5582\u517B\u7684\u5BB6\u957F\u8D8A\u6765\u8D8A\u591A\uFF0C\u7531\u4E8E\u6CA1\u6709\u50A8\u5907\u76F8\u5173\u77E5\u8BC6\uFF0C\u5BFC\u81F4\u6BCD\u4E73\u5582\u517B\u4E0D\u6210\u529F\uFF0C\u4E00\u4E9B\u5B69\u5B50\u6CA1\u80FD\u5F97\u5230\u5145\u8DB3\u7684\u5582\u517B\uFF0C\u5BFC\u81F4\u9EC4\u75B8\u52A0\u91CD\uFF0C\u4E0D\u5F97\u4E0D\u63A5\u53D7\u5149\u7597\u3002</p><p>\u4E3A\u4EC0\u4E48\u5582\u517B\u4E0D\u8DB3\u5BB9\u6613\u5BFC\u81F4\u9EC4\u75B8\u4E25\u91CD\u5462\uFF1F\u4E3B\u8981\u56E0\u4E3A\u5B69\u5B50\u51FA\u751F\u540E\u5403\u7684\u5C11\uFF0C\u80A0\u8815\u52A8\u5C31\u5C11\uFF0C\u80CE\u7CAA\u6392\u51FA\u5EF6\u8FDF\u6216\u8005\u5C11\uFF0C\u4ECE\u800C\u5BFC\u81F4\u80CE\u7CAA\u91CC\u7684\u80C6\u7EA2\u7D20\u7ECF\u80A0\u9053\u518D\u5438\u6536\u589E\u52A0\u3002\u53E6\u5916\u8FD8\u6709\u4E9B\u7814\u7A76\u663E\u793A\u9965\u997F\u53EF\u4EE5\u4F7F\u809D\u810F\u5904\u7406\u80C6\u7EA2\u7D20\u7684\u76F8\u5173\u9176\u7684\u6D3B\u529B\u4E0D\u8DB3\uFF0C\u5BFC\u81F4\u4F53\u5185\u589E\u591A\u7684\u80C6\u7EA2\u7D20\u5F97\u4E0D\u5230\u53CA\u65F6\u7684\u5904\u7406\u3002</p><p>\u6BCD\u4E73\u5582\u517B\u5931\u8D25\u6027\u9EC4\u75B8\u901A\u5E38\u53D1\u751F\u5728\u51FA\u751F\u540E\u7684\u7B2C\u4E00\u5468\u3002\u56E0\u4E3A\u5B69\u5B50\u6BCD\u4E73\u6CA1\u80FD\u5403\u591F\uFF0C\u6240\u4EE5\u6709\u4E2A\u5171\u540C\u7279\u70B9\uFF0C\u5C31\u662F\u751F\u540E\u4F53\u91CD\u4E0B\u964D\u5FEB\u3002\u6B63\u5E38\u65B0\u751F\u513F\u751F\u540E\u76842\u30013\u5185\u5929\u90FD\u4F1A\u51FA\u73B0\u751F\u7406\u6027\u7684\u4F53\u91CD\u4E0B\u964D\uFF0C\u4E0B\u964D\u5E45\u5EA6\u5927\u6982\u662F\u51FA\u751F\u4F53\u91CD\u76844-7%\uFF0C\u5982\u679C\u4F53\u91CD\u4E0B\u964D\u8D85\u8FC7\u51FA\u751F\u4F53\u91CD\u768410%\uFF0C\u5219\u8BF4\u660E\u5B69\u5B50\u6444\u5165\u4E0D\u8DB3\uFF0C\u5BB9\u6613\u53D1\u751F\u6BCD\u4E73\u5582\u517B\u5931\u8D25\u6027\u9EC4\u75B8\uFF0C\u6240\u4EE5\u65B0\u751F\u513F\u65E9\u671F\u7684\u5582\u517B\u975E\u5E38\u91CD\u8981\u3002</p><p>\u6709\u6548\u7684\u5438\u542E\u3001\u5145\u8DB3\u7684\u6BCD\u4E73\u5206\u6CCC\u3001\u80CE\u4FBF\u987A\u5229\u7684\u6392\u51FA\u53EF\u4EE5\u51CF\u5C11\u9EC4\u75B8\u7684\u53D1\u751F\uFF0C\u6240\u4EE5\u8981\u9884\u9632\u6BCD\u4E73\u5582\u517B\u5931\u8D25\u6027\u9EC4\u75B8\uFF0C\u9700\u8981\u4EA7\u524D\u50A8\u5907\u597D\u6BCD\u4E73\u5582\u517B\u76F8\u5173\u77E5\u8BC6\uFF0C\u5206\u5A29\u540E\u7B2C\u4E00\u65F6\u95F4\u808C\u80A4\u63A5\u89E6\uFF0C\u542E\u5438\u4E73\u623F\u3002</p><p>\u4E0D\u8BBA\u4EA7\u5987\u4E73\u623F\u5F62\u6001\u548C\u5927\u5C0F\u600E\u6837\uFF0C\u90FD\u53EF\u4E3A\u81EA\u5DF1\u7684\u5B69\u5B50\u5206\u6CCC\u8DB3\u591F\u7684\u4E73\u6C41\uFF0C\u5173\u952E\u5C31\u662F\u8981\u505A\u5230\u51C6\u786E\u7684\u8854\u4E73\u548C\u9891\u7E41\u7684\u542E\u5438\uFF0C\u786E\u4FDD\u5B69\u5B50\u6BCF\u5929\u7684\u5C0F\u4FBF\u6B21\u6570\u8FBE\u52304-6\u6B21\uFF0C\u907F\u514D\u51FA\u751F\u540E\u4F53\u91CD\u4E0B\u964D\u5E45\u5EA6\u8FC7\u5927\uFF0C\u540C\u65F6\u907F\u514D\u7ED9\u5B69\u5B50\u5582\u7CD6\u6C34\u3002</p><p>\u9664\u975E\u4EA7\u5987\u8FDB\u884C\u8FC7\u4E00\u4E9B\u4E73\u623F\u624B\u672F\uFF0C\u5426\u5219\u51FA\u73B0\u4E73\u6C41\u5206\u6CCC\u4E0D\u8DB3\u7684\u53EF\u80FD\u6027\u6781\u4F4E\u3002\u5728\u6BCD\u4E73\u5582\u517B\u9047\u5230\u56F0\u96BE\u65F6\u8981\u79EF\u6781\u5BFB\u627E\u54FA\u4E73\u6280\u672F\u7684\u652F\u6301\uFF0C\u534F\u52A9\u521A\u51FA\u751F\u7684\u65B0\u751F\u513F\u8FDB\u884C\u6709\u6548\u7684\u5438\u542E\u3002\u5BF9\u4E8E\u9EC4\u75B8\u6BD4\u8F83\u4E25\u91CD\uFF0C\u5B9E\u5728\u6BCD\u4E73\u5582\u517B\u56F0\u96BE\u7684\u5B69\u5B50\uFF0C\u53EF\u4EE5\u8003\u8651\u6682\u65F6\u989D\u5916\u589E\u52A0\u914D\u65B9\u5976\u4EE5\u6539\u5584\u5B69\u5B50\u6444\u5165\u4E0D\u8DB3\u3002</p><p>\u901A\u8FC7\u5145\u8DB3\u7684\u5582\u517B\uFF0C\u6211\u4EEC\u53EF\u4EE5\u9884\u9632\u6BCD\u4E73\u5582\u517B\u5931\u8D25\u6027\u9EC4\u75B8\u7684\u53D1\u751F\u3002\u4F46\u9009\u62E9\u7EAF\u6BCD\u4E73\u5582\u517B\u6216\u8005\u6BCD\u4E73\u5582\u517B\u4E3A\u4E3B\u7684\u5BB6\u957F\uFF0C\u8FD8\u4F1A\u9762\u4E34\u7684\u53E6\u5916\u4E00\u4E2A\u95EE\u9898\uFF0C\u90A3\u5C31\u662F\u5176\u4E2D\u5C06\u8FD1\u4E09\u5206\u4E4B\u4E00\u7684\u5B69\u5B50\u4F1A\u51FA\u73B0\u9EC4\u75B8\u6301\u7EED\u4E0D\u9000\u3002\u8FD9\u79CD\u9EC4\u75B8\u51FA\u73B0\u65F6\u95F4\u8F83\u665A\uFF0C\u901A\u5E38\u53D1\u751F\u5728\u51FA\u751F1\u5468\u4EE5\u540E\uFF0C\u591A\u6570\u6301\u7EED4-6\u5468\uFF0C\u4E2A\u522B\u751A\u81F3\u957F\u8FBE2-3\u6708\uFF0C\u4E5F\u5C31\u662F\u6211\u4EEC\u6240\u8BF4\u7684\u6BCD\u4E73\u6027\u9EC4\u75B8\u3002</p><p>\u5403\u6BCD\u4E73\u7684\u5B69\u5B50\u9EC4\u75B8\u4E3A\u4EC0\u4E48\u6D88\u9000\u7F13\u6162\u5462\uFF1F\u6211\u4EEC\u53D1\u73B0\u6BCD\u4E73\u6027\u9EC4\u75B8\u7684\u5B69\u5B50\u6682\u65F6\u4E2D\u65AD\u6BCD\u4E73\uFF0C\u6539\u914D\u65B9\u5976\u5582\u517B\u540E\u9EC4\u75B8\u53EF\u660E\u663E\u4E0B\u964D\uFF0C\u518D\u6B21\u6BCD\u4E73\u5582\u517B\uFF0C\u9EC4\u75B8\u53C8\u4E0A\u5347\u3002\u6240\u4EE5\u63A8\u6D4B\u662F\u56E0\u4E3A\u6BCD\u4E73\u4E2D\u7684\u4E00\u4E9B\u7269\u8D28\uFF0C\u73B0\u5728\u4E00\u822C\u8BA4\u4E3A\u662F\u4E00\u79CD\u53EB\u03B2-\u8461\u8404\u7CD6\u919B\u9178\u82F7\u9176\u7684\u7269\u8D28\u6240\u81F4\u3002</p><p>\u8FD9\u79CD\u9176\u53EF\u6C34\u89E3\u5B69\u5B50\u5C0F\u80A0\u5185\u90A3\u4E9B\u672C\u5E94\u88AB\u6392\u6CC4\u7684\u7ED3\u5408\u80C6\u7EA2\u7D20\uFF0C\u4F7F\u5176\u8F6C\u53D8\u6210\u672A\u7ED3\u5408\u80C6\u7EA2\u7D20\uFF0C\u7136\u540E\u53C8\u88AB\u80A0\u9053\u91CD\u5438\u6536\u56DE\u4EBA\u4F53\uFF0C\u4ECE\u800C\u5F15\u8D77\u9EC4\u75B8\u6301\u7EED\u4E0D\u9000\u3002</p><p>\u5BF9\u6210\u4EBA\u6765\u8BF4\uFF0C\u9EC4\u75B8\u610F\u5473\u7740\u75BE\u75C5\uFF0C\u4F46\u5BF9\u65B0\u751F\u513F\u548C\u5C0F\u5A74\u513F\uFF0C\u9EC4\u75B8\u53EF\u4EE5\u662F\u4E00\u79CD\u751F\u7406\u72B6\u6001\uFF0C\u5E76\u4E0D\u4E00\u5B9A\u610F\u5473\u7740\u75BE\u75C5\u3002\u76EE\u524D\u6211\u4EEC\u8BA4\u4E3A\u6BCD\u4E73\u6027\u9EC4\u75B8\u662F\u751F\u7406\u6027\u9EC4\u75B8\u7684\u5EF6\u7EED\uFF0C\u53EA\u8981\u5B69\u5B50\u7684\u80C6\u7EA2\u7D20\u6CA1\u6709\u8FBE\u5230\u5149\u7597\u7684\u6807\u51C6\uFF0C\u5C31\u4E0D\u5FC5\u5E72\u9884\u3002</p><p>\u80FD\u5BFC\u81F4\u5B69\u5B50\u9EC4\u75B8\u4E0D\u9000\u7684\u539F\u56E0\u6709\u5F88\u591A\uFF0C\u9664\u4E86\u6BCD\u4E73\u6027\u9EC4\u75B8\uFF0C\u4E00\u4E9B\u75BE\u75C5\u6BD4\u5982\u611F\u67D3\u3001\u80C6\u9053\u6897\u963B\u3001\u9057\u4F20\u4EE3\u8C22\u75C5\u7B49\u540C\u6837\u53EF\u5BFC\u81F4\u8FD9\u4E2A\u95EE\u9898\uFF0C\u800C\u6211\u4EEC\u76EE\u524D\u53C8\u6CA1\u6709\u529E\u6CD5\u5C06\u6BCD\u4E73\u6027\u9EC4\u75B8\u68C0\u6D4B\u51FA\u6765\u3002</p><p>\u56E0\u4E3A\u5BF9\u5BFC\u81F4\u9EC4\u75B8\u4E0D\u9000\u7684\u90A3\u4E9B\u75BE\u75C5\u6027\u56E0\u7D20\u7684\u62C5\u5FC3\uFF0C\u4EE5\u53CA\u6211\u4EEC\u8BA1\u5212\u514D\u75AB\u90E8\u95E8\u62D2\u7EDD\u7ED9\u9EC4\u75B8\u7684\u5B69\u5B50\u63A5\u79CD\u75AB\u82D7\uFF0C\u8BA9\u5BB6\u957F\u500D\u611F\u7126\u8651\uFF0C\u5BFC\u81F4\u5F88\u591A\u6BCD\u4E73\u6027\u9EC4\u75B8\u7684\u5B69\u5B50\u88AB\u8FC7\u5EA6\u7684\u68C0\u67E5\u548C\u6CBB\u7597\u3002</p><p>\u90A3\u6211\u4EEC\u5982\u4F55\u521D\u6B65\u5224\u65AD\u4E00\u4E2A\u5B69\u5B50\u7684\u9EC4\u75B8\u662F\u4E0D\u662F\u6BCD\u4E73\u6027\u9EC4\u75B8\u5462\uFF1F</p><p>\u9996\u5148\uFF0C\u6211\u4EEC\u9700\u8981\u6CE8\u610F\u5B69\u5B50\u7684\u5927\u4FBF\u989C\u8272\uFF0C\u5982\u679C\u5927\u4FBF\u989C\u8272\u662F\u91D1\u9EC4\u8272\u3001\u9EC4\u7EFF\u8272\u6216\u8005\u68D5\u8272\uFF0C\u8BF4\u660E\u5B69\u5B50\u6CA1\u6709\u80C6\u7BA1\u6897\u963B\u7684\u60C5\u51B5\u3002\u56E0\u4E3A\u80C6\u9053\u6897\u963B\u7684\u5B69\u5B50\u56E0\u4E3A\u80C6\u6C41\u6392\u4E0D\u901A\u7545\uFF0C\u4ED6\u4EEC\u7684\u5927\u4FBF\u989C\u8272\u591A\u5F88\u6D45\uFF0C\u65E9\u671F\u6DE1\u7EFF\u8272\uFF0C\u540E\u671F\u5448\u73B0\u7070\u767D\u8272\u7684\u9676\u571F\u6837\u3002\u80C6\u9053\u6897\u963B\u65F6\u95F4\u957F\u4F1A\u635F\u4F24\u809D\u810F\uFF0C\u5C24\u5176\u662F\u80C6\u9053\u95ED\u9501\u624B\u672F\u7684\u65F6\u95F4\u7A97\u6BD4\u8F83\u77ED\uFF0C\u4E00\u65E6\u9519\u8FC7\uFF0C\u9884\u540E\u4F1A\u5F88\u5DEE\uFF0C\u6240\u4EE5\u9EC4\u75B8\u7684\u5B69\u5B50\u89C2\u5BDF\u5927\u4FBF\u7684\u989C\u8272\u975E\u5E38\u91CD\u8981\u3002</p><p>\u5BF9\u4E8E\u4E00\u4E2A\u770B\u4F3C\u5065\u5EB7\u800C\u9EC4\u75B8\u6301\u7EED\u4E0D\u9000\u7684\u5B69\u5B50\uFF0C\u5C31\u533B\u8FD8\u662F\u6709\u5FC5\u8981\uFF0C\u81F3\u5C11\u53EF\u4EE5\u8BA9\u533B\u751F\u521D\u6B65\u6392\u67E5\u4E00\u4E0B\u6EB6\u8840\u3001\u611F\u67D3\u3001\u4EE3\u8C22\u7B49\u5176\u4ED6\u5C11\u89C1\u75BE\u75C5\u3002\u540C\u65F6\uFF0C\u6211\u4EEC\u53EF\u4EE5\u901A\u8FC7\u751F\u957F\u66F2\u7EBF\u6765\u76D1\u6D4B\u5B69\u5B50\u7684\u4F53\u91CD\u589E\u957F\uFF0C\u5982\u679C\u4F53\u91CD\u589E\u5E45\u826F\u597D\uFF0C\u6211\u4EEC\u5C31\u4E0D\u5FC5\u8FC7\u4E8E\u62C5\u5FC3\u3002</p><p>\u5C3D\u7BA1\u6BCD\u4E73\u6027\u9EC4\u75B8\u5BF9\u5B69\u5B50\u51E0\u4E4E\u6CA1\u4EC0\u4E48\u5F71\u54CD\uFF0C\u4F46\u4E5F\u6709\u6781\u5C11\u90E8\u5206\u5B69\u5B50\u4F1A\u51FA\u73B0\u6838\u9EC4\u75B8\uFF0C\u6240\u4EE5\u6211\u4EEC\u4ECD\u9700\u52A0\u5F3A\u7BA1\u7406\uFF0C\u6BD4\u5982\u5B9A\u671F\u5230\u533B\u751F\u90A3\u91CC\u968F\u8BBF\u3001\u76D1\u6D4B\u7ECF\u76AE\u80C6\u7EA2\u7D20\u7B49\uFF0C\u90E8\u5206\u6BCD\u4E73\u6027\u9EC4\u75B8\u7684\u5B69\u5B50\u4E5F\u662F\u9700\u8981\u7167\u5149\u6CBB\u7597\u3002</p><p>\u6211\u4EEC\u4E5F\u8981\u77E5\u9053\uFF0C\u7EDD\u5927\u90E8\u5206\u6BCD\u4E73\u6027\u9EC4\u75B8\u7684\u5B69\u5B50\u6CA1\u5FC5\u8981\u505C\u6B62\u6BCD\u4E73\u5582\u517B\uFF0C\u5373\u4F7F\u5B69\u5B50\u9700\u8981\u7167\u5149\u6CBB\u7597\uFF0C\u4ECD\u53EF\u7EE7\u7EED\u6BCD\u4E73\u5582\u517B\u3002\u540C\u65F6\u6211\u4EEC\u8FD8\u8981\u77E5\u9053\uFF0C\u4E0D\u8BBA\u4EC0\u4E48\u539F\u56E0\u5F15\u8D77\u7684\u9EC4\u75B8\uFF0C\u6211\u4EEC\u90FD\u6CA1\u6709\u5FC5\u8981\u7ED9\u5B69\u5B50\u7528\u76CA\u751F\u83CC\u4EE5\u53CA\u8335\u6800\u9EC4\u4E4B\u7C7B\u7684\u4E2D\u6210\u836F\u3002</p><p>\u76F8\u5173\u9605\u8BFB\uFF0C\u5173\u6CE8\u516C\u4F17\u53F7<strong>drpei</strong></p><p>\u56DE\u590D\u201C<strong>\u9EC4\u75B8</strong>\u201D\u4E86\u89E3\uFF1A<strong>\u5982\u4F55\u5E94\u5BF9\u5B9D\u5B9D\u9EC4\u75B8\uFF1F</strong></p><p>\u56DE\u590D\u201C<strong>\u8335\u6800\u9EC4</strong>\u201D\u4E86\u89E3\uFF1A<strong>\u8335\u6800\u9EC4\u4E3A\u4EC0\u4E48\u4E0D\u80FD\u5403\uFF1F</strong></p><hr><p>\u4F5C\u8005\u4ECB\u7ECD\uFF1A\u4E25\u864E\uFF0C\u4E0A\u6D77\u7B2C\u4E00\u5987\u5A74\u513F\u79D1\u533B\u751F\u3002</p><p>\u957F\u6309\u4E0B\u9762\u4E8C\u7EF4\u7801\u52A0\u5173\u6CE8\uFF0C\u53EF\u5411\u4E25\u533B\u751F\u54A8\u8BE2<strong>\u9EC4\u75B8</strong>\u3001<strong>\u53D1\u70E7</strong>\u3001<strong>\u54B3\u55FD</strong>\u3001<strong>\u8179\u6CFB</strong>\u3001<strong>\u4FBF\u79D8</strong>\u7B49\u95EE\u9898\u3002</p>',27),i={href:"http://mp.weixin.qq.com/s?__biz=MzA5NzE5ODIyOQ==&mid=2651626413&idx=1&sn=b18558ef5dba9d090e6cfae4486bf8ba&chksm=8b5cb257bc2b3b41b2e0e53b160408d59f0119afb6ab4008df70aab115bb9b750369d06bebed&scene=21#wechat_redirect",target:"_blank",rel:"noopener noreferrer"},_=c("\u67E5\u770B\u539F\u6587");function h(l,f){const p=r("ExternalLinkIcon");return t(),n(s,null,[b,e("p",null,[e("a",i,[_,o(p)])])],64)}var u=d(g,[["render",h]]);export{u as default};
